insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (1, 1, 'FalconSat', false, '2006', '2006-2-5 23:30:0', false, false, 'falcon1', 'kwajalein_atoll', 'Engine failure at 33 seconds and loss of vehicle', false, null, 'Merlin1A');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (2, 2, 'DemoSat', false, '2007', '2007-2-3 2:10:0', false, false, 'falcon1', 'kwajalein_atoll', 'Successful first stage burn and transition to second stage, maximum altitude 289 km, Premature engine shutdown at T+7 min 30 s, Failed to reach orbit, Failed to recover first stage', false, null, 'Merlin2A');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (3, 3, 'Trailblazer', false, '2008', '2008-7-6 5:34:0', false, false, 'falcon1', 'kwajalein_atoll', 'Residual stage 1 thrust led to collision between stage 1 and stage 2', false, null, 'Merlin1C');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (4, 4, 'RatSat', false, '2008', '2008-8-1 1:15:0', false, false, 'falcon1', 'kwajalein_atoll', 'Ratsat was carried to orbit on the first successful orbital launch of any privately funded and developed, liquid-propelled carrier rocket, the SpaceX Falcon 1', true, null, 'Merlin2C');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (5, 5, 'RazakSat', false, '2009', '2009-6-1 5:35:0', false, false, 'falcon1', 'kwajalein_atoll', null, true, null, 'Merlin3C');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (6, 6, 'Falcon 9 Test Flight', false, '2010', '2010-5-5 20:45:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, null, 'B0003');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (7, 7, 'COTS 1', false, '2010', '2010-11-3 16:43:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, 'dragon1', 'B0004');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (8, 8, 'COTS 2', false, '2012', '2012-4-3 9:44:0', false, false, 'falcon9', 'ccafs_slc_40', 'Launch was scrubbed on first attempt, second launch attempt was successful', true, 'dragon1', 'B0005');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (9, 9, 'CRS-1', false, '2012', '2012-9-1 2:35:0', false, false, 'falcon9', 'ccafs_slc_40', 'CRS-1 successful, but the secondary payload was inserted into abnormally low orbit and lost due to Falcon 9 boost stage engine failure, ISS visiting vehicle safety rules, and the primary payload owner&#39;s contractual right to decline a second ignition of the second stage under some conditions.', true, 'dragon1', 'B0006');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (10, 10, 'CRS-2', false, '2013', '2013-2-5 20:10:0', false, false, 'falcon9', 'ccafs_slc_40', 'Last launch of the original Falcon 9 v1.0 launch vehicle', true, 'dragon1', 'B0007');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (11, 11, 'CASSIOPE', false, '2013', '2013-8-0 18:0:0', false, false, 'falcon9', 'vafb_slc_4e', 'Commercial mission and first Falcon 9 v1.1 flight, with improved 13-tonne to LEO capacity. Following second-stage separation from the first stage, an attempt was made to perform an ocean touchdown test of the discarded booster vehicle. The test provided good test data on the experiment-its primary objective-but as the booster neared the ocean, aerodynamic forces caused an uncontrollable roll. The center engine, depleted of fuel by centrifugal force, shut down resulting in the impact and destruction of the vehicle.', true, null, 'B1003');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (12, 12, 'SES-8', false, '2013', '2013-11-2 23:41:0', false, false, 'falcon9', 'ccafs_slc_40', 'First GTO launch for Falcon 9', true, null, 'B1004');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (13, 13, 'Thaicom 6', false, '2014', '2014-0-1 19:6:0', false, false, 'falcon9', 'ccafs_slc_40', 'Second GTO launch for Falcon 9. The USAF evaluated launch data from this flight as part of a separate certification program for SpaceX to qualify to fly U.S. military payloads and found that the Thaicom 6 launch had "unacceptable fuel reserves at engine cutoff of the stage 2 second burnoff"', true, null, 'B1005');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (14, 14, 'CRS-3', false, '2014', '2014-3-5 21:25:0', false, false, 'falcon9', 'ccafs_slc_40', 'Following second-stage separation, SpaceX conducted a second controlled-descent test of the discarded booster vehicle and achieved the first successful controlled ocean touchdown of a liquid-rocket-engine orbital booster. Following touchdown the first stage tipped over as expected and was destroyed. This was the first Falcon 9 booster to fly with extensible landing legs and the first Dragon mission with the Falcon 9 v1.1 launch vehicle.', true, 'dragon1', 'B1006');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (15, 15, 'OG-2 Mission 1', false, '2014', '2014-6-1 17:15:0', false, false, 'falcon9', 'ccafs_slc_40', 'Total payload mass was 1,316 kg (2,901 lb) : 6 satellites weighing 172 kg each, plus two 142-kg mass simulators. This was the second Falcon 9 booster equipped with landing legs. Following second-stage separation, SpaceX conducted a controlled-descent test of the first stage, which successfully decelerated from hypersonic velocity in the upper atmosphere, made reentry and landing burns, deployed its legs and touched down on the ocean surface. As with the previous mission, the first stage then tipped over as expected and was not recovered.', true, null, 'B1007');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (16, 16, 'AsiaSat 8', false, '2014', '2014-7-2 10:0:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, null, 'B1008');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (17, 17, 'AsiaSat 6', false, '2014', '2014-8-0 7:0:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, null, 'B1011');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (18, 18, 'CRS-4', false, '2014', '2014-8-0 7:52:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, 'dragon1', 'B1010');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (19, 19, 'CRS-5', false, '2015', '2015-0-6 10:47:0', false, false, 'falcon9', 'ccafs_slc_40', 'Following second stage separation, SpaceX performed a test flight which attempted to return the first stage of the Falcon 9 through the atmosphere and land it on an approximately 90-by-50-meter (300 ft x 160 ft) floating platform-called the autonomous spaceport drone ship. Many of the test objectives were achieved, including precision control of the rocket&#39;s descent to land on the platform at a specific point in the Atlantic ocean, and a large amount of test data was obtained from the first use of grid fin control surfaces used for more precise reentry positioning. The grid fin control system ran out of hydraulic fluid a minute before landing and the landing itself resulted in a crash.', true, 'dragon1', 'B1012');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (20, 20, 'DSCOVR', false, '2015', '2015-1-4 0:3:0', false, false, 'falcon9', 'ccafs_slc_40', 'First launch under USAF&#39;s OSP 3 launch contract. First SpaceX launch to put a satellite to an orbit with an orbital altitude many times the distance to the Moon: Sun-Earth libration point L1. The first stage made a test flight descent to an over-ocean landing within 10 m (33 ft) of its intended target.', true, null, 'B1013');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (21, 21, 'ABS-3A / Eutelsat 115W B', false, '2015', '2015-2-1 4:50:0', false, false, 'falcon9', 'ccafs_slc_40', 'The launch was Boeing&#39;s first-ever conjoined launch of a lighter-weight dual-commsat stack that was specifically designed to take advantage of the lower-cost SpaceX Falcon 9 launch vehicle. Per satellite, launch costs were less than $30 million. The ABS satellite reached its final destination ahead of schedule and started operations on September 10.', true, null, 'B1014');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (22, 22, 'CRS-6', false, '2015', '2015-3-2 22:10:0', false, false, 'falcon9', 'ccafs_slc_40', 'Following the first-stage boost, SpaceX attempted a controlled-descent test of the first stage. The first stage contacted the ship, but soon tipped over due to excess lateral velocity caused by a stuck throttle valve resulting in a later-than-intended downthrottle.', true, 'dragon1', 'B1015');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (23, 23, 'TürkmenÄlem 52°E / MonacoSAT', false, '2015', '2015-3-2 1:3:0', false, false, 'falcon9', 'ccafs_slc_40', null, true, null, 'B1016');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (24, 24, 'CRS-7', false, '2015', '2015-5-0 16:21:0', false, false, 'falcon9', 'ccafs_slc_40', 'Launch performance was nominal until an overpressure incident in the second-stage LOX tank, leading to vehicle breakup at T+150 seconds. The Dragon capsule survived the explosion but was lost upon splashdown because its software did not contain provisions for parachute deployment on launch vehicle failure.', false, 'dragon1', 'B1018');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (25, 25, 'OG-2 Mission 2', false, '2015', '2015-11-2 2:29:0', false, false, 'falcon9', 'ccafs_slc_40', 'Total payload mass was 2,034 kg (4,484 lb) : 11 satellites weighing 172 kg each, plus a 142-kg mass simulator. This was the first launch of the upgraded v1.1 variant (later called Falcon 9 Full Thrust), with a 30 percent power increase. Orbcomm had originally agreed to be the third flight of the enhanced-thrust rocket, but the change to the maiden flight position was announced in October 2015. SpaceX received a permit from the FAA to land the booster on solid ground at Cape Canaveral, and succeeded.', true, null, 'B1019');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (26, 26, 'Jason 3', false, '2016', '2016-0-0 16:42:0', false, false, 'falcon9', 'vafb_slc_4e', 'First launch of NASA and NOAA joint science mission under the NLS II launch contract (not related to NASA CRS or USAF OSP3 contracts). Last launch of the original Falcon 9 v1.1 launch vehicle. The Jason-3 satellite was successfully deployed to target orbit. SpaceX again attempted a recovery of the first stage booster by landing on an autonomous drone ship; this time located in the Pacific Ocean. The first stage did achieve a soft-landing on the ship, but a lockout on one of the landing legs failed to latch, so that the booster fell over and exploded.', true, null, 'B1017');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (27, 27, 'SES-9', false, '2016', '2016-2-6 0:35:0', false, false, 'falcon9', 'ccafs_slc_40', 'Second launch of the enhanced Falcon 9 Full Thrust launch vehicle. Following the launch, SpaceX attempted an experimental landing test to a drone ship, although a successful landing was not expected because launch mass exceeded previously indicated limit for a GTO there was little fuel left. As predicted, booster recovery failed: the spent first stage "landed hard", but the controlled-descent, atmospheric re-entry and navigation to the drone ship were successful and returned significant test data on bringing back high-energy Falcon 9s.', true, null, 'B1020');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (28, 28, 'CRS-8', false, '2016', '2016-3-5 22:43:0', false, false, 'falcon9', 'ccafs_slc_40', 'Dragon carried over 1500 kg of supplies and delivered (stowed in its trunk) the inflatable Bigelow Expandable Activity Module (BEAM) to the ISS for two years of in-orbit tests. The rocket&#39;s first stage landed smoothly on SpaceX&#39;s autonomous spaceport drone ship 9 minutes after liftoff, making this the first ever successful landing of a rocket booster on a ship at sea as part of an orbital launch. The first stage B1021 was later also the first orbital booster to be used again, when launching SES-10 on March 30, 2017.', true, 'dragon1', 'B1021');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (29, 29, 'JCSAT-2B', false, '2016', '2016-4-5 7:21:0', false, false, 'falcon9', 'ccafs_slc_40', 'Launched the JCSAT 14 communications satellite for Tokyo-based SKY Perfect JSAT Corp. JCSAT 14 will support data networks, television broadcasters and mobile communications users in Japan, East Asia, Russia, Oceania, Hawaii and other Pacific islands. This was the first time a booster successfully landed after a GTO mission.', true, null, 'B1022');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (30, 30, 'Thaicom 8', false, '2016', '2016-4-5 23:39:0', false, false, 'falcon9', 'ccafs_slc_40', 'Manufactured by Orbital ATK, the 3,100-kilogram (6,800 lb) Thaicom 8 communications satellite will serve Thailand, India and Africa from the 78.5° East geostationary location. It is equipped with 24 active Ku-band transponders.', true, null, 'B1023');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (31, 31, 'ABS-2A / Eutelsat 117W B', false, '2016', '2016-5-3 16:29:0', false, false, 'falcon9', 'ccafs_slc_40', 'One year after pioneering this technique on flight 16, Falcon again launched two Boeing 702SP gridded ion thruster satellites in a dual-stack configuration, with the two customers sharing the rocket and mission costs. First stage landing attempt on drone ship failed on landing due to low thrust on one of the three landing engines.', true, null, 'B1024');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (32, 32, 'CRS-9', false, '2016', '2016-6-1 6:45:0', false, false, 'falcon9', 'ccafs_slc_40', 'Among other cargo, an International Docking Adapter (IDA-2) was carried to the ISS. This mission had a successful first-stage landing at Cape Canaveral.*Including the reusable Dragon Capsule, total payload to orbit was 6457 kg.', true, 'dragon1', 'B1025');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (33, 33, 'JCSAT-16', false, '2016', '2016-7-0 7:26:0', false, false, 'falcon9', 'ccafs_slc_40', 'First attempt to touch down from a ballistic trajectory using a single-engine landing burn. All previous landings from a ballistic trajectory had fired three engines on the landing-burn, which provided more braking force, but subjected the vehicle to greater structural stresses. The single-engine landing burn takes more time and fuel, but puts less stress on the vehicle.', true, null, 'B1026');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (34, 34, 'Amos-6', false, '2016', '2016-8-4 15:7:0', false, false, 'falcon9', 'ccafs_slc_40', 'The rocket and Amos-6 payload were lost in a launch pad explosion on September 1, 2016 during propellant fill prior to a static fire test. The pad was clear of personnel and there were no injuries.', false, null, 'B1028');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (35, 35, 'Iridium NEXT Mission 1', false, '2017', '2017-0-6 18:54:0', false, false, 'falcon9', 'vafb_slc_4e', 'Return-to-flight mission after the loss of Amos-6 in September 2016. Iridium NEXT will replace the original Iridium constellation, launched in the late 1990s. Each Falcon mission will carry 10 satellites, with a goal to complete deployment of the 66 plus 9 spare satellite constellation by mid 2018. The first two Iridium qualification units were supposed to ride a Dnepr rocket in April 2016 but were delayed, so Iridium decided to qualify the first batch of 10 satellites instead.', true, null, 'B1029');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (36, 36, 'CRS-10', false, '2017', '2017-1-0 15:39:0', false, false, 'falcon9', 'ksc_lc_39a', 'First Falcon 9 flight from the historic LC-39A launchpad at Kennedy Space Center, carrying supplies and materials to support dozens of science and research investigations scheduled during ISS Expeditions 50 and 51. The first stage returned to launch site and landed at LZ-1.', true, 'dragon1', 'B1031');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (37, 37, 'EchoStar 23', false, '2017', '2017-2-4 7:0:0', false, false, 'falcon9', 'ksc_lc_39a', 'Communications satellite for EchoStar Corp. EchoStar XXIII, based on a spare platform from the cancelled CMBStar 1 satellite program, will provide direct-to-home television broadcast services over Brazil. There was no attempt at a first-stage recovery so this rocket did not have landing legs or grid fins.', true, null, 'B1030');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (38, 38, 'SES-10', false, '2017', '2017-2-5 0:27:0', false, false, 'falcon9', 'ksc_lc_39a', 'First payload to fly on a reused first stage, B1021, previously launched with CRS-8, which also landed a second time. In what is also a first, the payload fairing remained intact after a successful splashdown achieved with thrusters and a steerable parachute.', true, null, 'B1021');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (39, 39, 'NROL-76', false, '2017', '2017-4-1 13:15:0', false, false, 'falcon9', 'ksc_lc_39a', 'First launch under SpaceX&#39;s certification for national security space missions, which allows SpaceX to contract launch services for classified payloads. Second-stage speed and altitude telemetry were omitted from the launch webcast, which displayed first-stage telemetry instead, with continuous tracking of the booster from liftoff to landing for the first time.', true, null, 'B1032');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (40, 40, 'Inmarsat-5 F4', false, '2017', '2017-4-2 1:21:0', false, false, 'falcon9', 'ksc_lc_39a', 'At 6,070 kg this was the heaviest payload launched to GTO by a Falcon 9 rocket. The launch was originally scheduled for the Falcon Heavy, but performance improvements allowed the mission to be carried out by an expendable Falcon 9 instead.', true, null, 'B1034');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (41, 41, 'CRS-11', false, '2017', '2017-5-6 23:7:0', false, false, 'falcon9', 'ksc_lc_39a', 'This mission delivered the Neutron Star Interior Composition Explorer (NICER) to the ISS, along with the MUSES Earth imaging platform and ROSA solar array. For the first time, this mission launched a refurbished Dragon capsule, serial number C106 which first flew in September 2014 on the CRS-4 mission. Originally scheduled to launch on June 1, but was scrubbed due to inclement weather.', true, 'dragon1', 'B1035');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (42, 42, 'BulgariaSat-1', false, '2017', '2017-5-5 21:10:0', false, false, 'falcon9', 'ksc_lc_39a', 'Second time a booster will be reused: Second flight of B1029 after the Iridium mission of January 2017. The satellite will be the first commercial Bulgarian-owned communications satellite and it will provide television broadcasts and other communications services over southeast Europe.', true, null, 'B1029');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (43, 43, 'Iridium NEXT Mission 2', false, '2017', '2017-5-0 22:25:0', false, false, 'falcon9', 'vafb_slc_4e', 'First flight with titanium grid fins to improve control authority and better cope with heat during re-entry.', true, null, 'B1036');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (44, 44, 'Intelsat 35e', false, '2017', '2017-6-4 1:35:0', false, false, 'falcon9', 'ksc_lc_39a', 'Due to the constraints of sending a heavy satellite (~6,000 kg) to GTO, the rocket will fly in its expendable configuration and the first-stage booster will not be recovered.', true, null, 'B1037');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (45, 45, 'CRS-12', false, '2017', '2017-7-1 18:31:0', false, false, 'falcon9', 'ksc_lc_39a', 'Dragon is expected to carry 2,349 kg (5,179 lb) of pressurized mass and 961 kg (2,119 lb) unpressurized. The external payload manifested for this flight is the CREAM cosmic-ray detector. First flight of the Falcon 9 Block 4 upgrade. Last flight of a newly-built Dragon capsule; further missions will use refurbished spacecraft.', true, 'dragon1', 'B1039');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (46, 46, 'FormoSat-5', false, '2017', '2017-7-4 20:50:0', false, false, 'falcon9', 'vafb_slc_4e', 'Formosat-5 is an Earth observation satellite of the Taiwanese space agency. The SHERPA space tug by Spaceflight Industries was removed from the cargo manifest of this mission. The satellite has a mass of only 475 kg.', true, null, 'B1038');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (47, 47, 'Boeing X-37B OTV-5', false, '2017', '2017-8-4 15:50:0', false, false, 'falcon9', 'ksc_lc_39a', 'Notable because Boeing is the primary contractor of the X-37B, which has until now been launched by ULA, a SpaceX competitor and Boeing partnership. Second flight of the Falcon 9 Block 4 upgrade.', true, null, 'B1040');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (48, 48, 'Iridium NEXT Mission 3', false, '2017', '2017-9-1 14:37:0', false, false, 'falcon9', 'vafb_slc_4e', 'Third of eight missions to launch Iridium&#39;s second generation constellation from VAFB', true, null, 'B1041');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (49, 49, 'SES-11 / Echostar 105', false, '2017', '2017-9-4 0:53:0', false, false, 'falcon9', 'ksc_lc_39a', 'Nineteenth comsat to GTO, also the fourth satellite launched for SES and second for Echostar. Third time a first stage booster will be reused.', true, null, 'B1031');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (50, 50, 'KoreaSat 5A', false, '2017', '2017-9-1 20:34:0', false, false, 'falcon9', 'ksc_lc_39a', 'KoreaSat 5A is a Ku-band satellite capable of providing communication services from East Africa and Central Asia to southern India, Southeast Asia, the Philippines, Guam, Korea, and Japan. The satellite will be placed in GEO at 113Â° East Longitude, and will provide services ranging from broadband internet to broadcasting services and maritime communications.', true, null, 'B1042');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (51, 51, 'CRS-13', false, '2017', '2017-11-5 16:36:0', false, false, 'falcon9', 'ccafs_slc_40', 'Will reuse the Dragon capsule previously flown on CRS-6 and will reuse the booster from CRS-11.', true, 'dragon1', 'B1035');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (52, 52, 'Iridium NEXT Mission 4', false, '2017', '2017-11-6 2:27:23', false, false, 'falcon9', 'vafb_slc_4e', 'Reusing the booster first used on Iridium-2, but will be flying expendable.', true, null, 'B1036');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (53, 53, 'ZUMA', false, '2018', '2018-0-1 2:0:0', false, false, 'falcon9', 'ccafs_slc_40', 'Originally planned for mid-November 2017, the mission was delayed due to test results from the fairing of another customer. First-stage booster will attempt landing at LZ-1', true, null, 'B1043');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (54, 54, 'SES-16 / GovSat-1', false, '2018', '2018-0-3 22:25:0', false, false, 'falcon9', 'ccafs_slc_40', 'Reused booster from the classified NROL-76 mission in May 2017. Following a successful experimental ocean landing that used three engines, the booster unexpectedly remained intact; Elon Musk stated in a tweet that SpaceX will attempt to tow the booster to shore.', true, null, 'B1032');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (55, 55, 'Falcon Heavy Test Flight', false, '2018', '2018-1-2 21:45:0', false, false, 'falconheavy', 'ksc_lc_39a', 'The launch was a success, and the side boosters landed simultaneously at adjacent ground pads. Drone ship landing of the central core failed. Final burn to heliocentric mars-earth orbit was successful after the second stage and payload passed through the Van Allen belts.', true, null, 'B1033');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (56, 56, 'Paz / Starlink Demo', false, '2018', '2018-1-4 15:17:0', false, false, 'falcon9', 'vafb_slc_4e', 'First flight with fairing 2.0. Will also carry two SpaceX test satellites for the upcoming Starlink constellation.', true, null, 'B1038');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (57, 57, 'Hispasat 30W-6', false, '2018', '2018-2-2 6:33:0', false, false, 'falcon9', 'ccafs_slc_40', 'Launched with landing legs and titanium grid fins. Did not attempt a landing due to &#39;unfavorable weather conditions in the recovery area&#39;.', true, null, 'B1044');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (58, 58, 'Iridium NEXT Mission 5', false, '2018', '2018-2-5 16:13:51', false, false, 'falcon9', 'vafb_slc_4e', 'Fifth Iridium NEXT mission to deploy ten Iridium NEXT satellites. Reused booster from third Iridium flight, and although controlled descent was performed, the booster was expended into the ocean. SpaceX planned a second recovery attempt of one half of the fairing using the specially modified boat Mr. Steven. However, the fairing&#39;s parafoil twisted during the recovery, which led to water impact at high speed', true, null, 'B1041');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (59, 59, 'CRS-14', false, '2018', '2018-3-1 22:30:41', false, false, 'falcon9', 'ccafs_slc_40', 'The launch used a refurbished booster (from CRS-12) for the 11th time, and a refurbished capsule (C110 from CRS-8) for the third time. External payloads include a materials research platform MISSE-FF phase 3 of the Robotic Refueling Mission TSIS, heliophysics sensor several crystallization experiments, and the RemoveDebris spacecraft aimed at space junk removal. The booster was expended in order to test a new landing profile.', true, 'dragon1', 'B1039');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (60, 60, 'TESS', false, '2018', '2018-3-4 0:51:0', false, false, 'falcon9', 'ccafs_slc_40', 'Part of the Explorers program, this space telescope is intended for wide-field search of exoplanets transiting nearby stars. It is the first NASA high priority science mission launched by SpaceX. It was the first time SpaceX launched a scientific satellite not primarily intended for Earth observations. The second stage placed it into a high-Earth elliptical orbit, after which the satellite&#39;s own booster will perform complex maneuvers including a lunar flyby, and over the course of two months, reach a stable, 2:1 resonant orbit with the Moon. In January 2018, SpaceX received NASA&#39;s Launch Services Program Category 2 certification of its Falcon 9 &#39;Full Thrust&#39;, certification which is required for launching medium risk missions like TESS. It was the last launch of a new Block 4 booster, and marked the 24th successful recovery of the booster. An experimental water landing was performed in order to attempt fairing recovery.', true, null, 'B1045');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (61, 61, 'Bangabandhu-1', false, '2018', '2018-4-5 22:14:0', false, false, 'falcon9', 'ksc_lc_39a', 'First launch of a Block V first stage.', true, null, 'B1046');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (62, 62, 'Iridium NEXT Mission 6', false, '2018', '2018-4-2 21:47:58', false, false, 'falcon9', 'vafb_slc_4e', 'GFZ arranged a rideshare of GRACE-FO on a Falcon 9 with Iridium following the cancellation of their Dnepr launch contract in 2015. Iridium CEO Matt Desch disclosed in September 2017 that GRACE-FO would be launched on the sixth Iridium NEXT mission. The booster reuse turnaround was a record 4.5 months between flights.', true, null, 'B1043');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (63, 63, 'SES-12', false, '2018', '2018-5-1 6:45:0', false, false, 'falcon9', 'ccafs_slc_40', 'SES-12, the replacement satellite for NSS-6, was successfully launched and deployed on June 4th, completing SpaceX&#39;s eleventh flight of 2018. According to SES Luxembourg, The SES-12 satellite will expand SES’s capabilities to provide direct-to-home (DTH) broadcasting, VSAT, Mobility and High Throughput Satellite (HTS) data connectivity services in the Middle East and the Asia-Pacific region, including rapidly growing markets such as India and Indonesia. [SES-12] will be co-located with SES-8', true, null, 'B1040');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (64, 64, 'CRS-15', false, '2018', '2018-5-5 11:42:0', false, false, 'falcon9', 'ccafs_slc_40', 'Payload included MISSE-FF 2, ECOSTRESS, and a Latching End Effector. The refurbished booster featured a record 2.5 months period turnaround from its original launch of the TESS satellite — the fastest previous was 4.5 months. This was the last commercial flight of a Block 4 booster, which was expended into the Atlantic without landing legs and grid fins.', true, 'dragon1', 'B1045');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (65, 65, 'Telstar 19V', false, '2018', '2018-6-0 7:50:0', false, false, 'falcon9', 'ccafs_slc_40', 'SSL-manufactured communications satellite intended to be placed at 63° West over the Americas. At 7,075 kg, it became the heaviest commercial communications satellite ever launched.', true, null, 'B1047');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (66, 66, 'Iridium NEXT Mission 7', false, '2018', '2018-6-3 13:39:26', false, false, 'falcon9', 'vafb_slc_4e', 'SpaceX&#39;s fourteenth flight of 2018 and seventh of eight launches in a half-a-billion-dollar contract with Iridium. Will use a Block 5 first stage, to be recovered in the Pacific Ocean. Only one mission will be left for Iridium, with 10 more satellites. First attempt to recover a Fairing with the upgraded net. Fairing recovery was not successful.', true, null, 'B1048');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (67, 67, 'Merah Putih', false, '2018', '2018-7-2 7:18:0', false, false, 'falcon9', 'ccafs_slc_40', 'SpaceX&#39;s fifteenth flight of 2018 launched the Merah Putih (also known as Telkom-4) geostationary communications satellite for Telkom Indonesia. It marked the first reuse of any Block 5 first stage; the booster B1046 had previously launched Bangabandhu-1. The stage was recovered and is expected to become the first Falcon 9 booster to fly three missions.', true, null, 'B1046');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (68, 68, 'Telstar 18V', false, '2018', '2018-8-1 6:45:0', false, false, 'falcon9', 'ccafs_slc_40', 'SpaceX&#39;s sixteenth flight of 2018 launched the Telstar 18v GEO communication satellite for Telesat, the second launch for the canadian company in a few months. The first stage was a new Falcon 9 V1.2 Block 5 which was successfully recovered on OCISLY.', true, null, 'B1049');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (69, 69, 'SAOCOM 1A', false, '2018', '2018-9-1 4:22:0', false, false, 'falcon9', 'vafb_slc_4e', 'SpaceX&#39;s seventeenth flight of 2018 was the first launch of the Saocom Earth observation satellite constellation of the Argentine Space Agency CONAE. The second launch of Saocom 1B will happen in 2019. This flight marked the first RTLS launch out of Vandenberg, with a landing on the concrete pad at SLC-4W, very close to the launch pad.', true, null, 'B1048');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (70, 70, 'Es’hail 2', false, '2018', '2018-10-4 21:46:0', false, false, 'falcon9', 'ksc_lc_39a', 'SpaceX&#39;s eighteenth flight of 2018 was its first for Es&#39;hailSat. Es&#39;hail-2 is a communications satellite delivering television and internet to Qatar and the surrounding region. It was launched into a geostationary transfer orbit from LC-39A at Kennedy Space Center. The booster landed on OCISLY.', true, null, 'B1047');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (71, 71, 'SSO-A', false, '2018', '2018-11-1 19:32:0', false, false, 'falcon9', 'vafb_slc_4e', 'SpaceX&#39;s nineteenth flight of 2018 will fly SSO-A: SmallSat Express out of Vandenberg SLC-4E for Spaceflight. SSO-A is a rideshare to sun synchronus low earth orbit consisting of 64 individual microsatellites and cubesats. It is also likely to be the third flight of core B1046 which previously flew Bangabandhu-1 and Merah Putih. If this happens it will be the first time a Falcon 9 has flown more than two missions. ', true, null, 'B1046');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (72, 72, 'CRS-16', false, '2018', '2018-11-3 19:16:0', false, false, 'falcon9', 'ccafs_slc_40', 'SpaceX&#39;s 16th Crew Resupply Mission on behalf of NASA, with a total of 20 contracted flights. This will bring essential supplies to the International Space Station using SpaceX&#39;s reusable Dragon spacecraft. The Falcon 9 will launch from SLC-40 at Cape Canaveral Air Force Station. During the landing of the first stage, a grid fin hydraulic pump stalled, causing the core to enter an uncontrolled roll, and resulting in a (succesful) water landing.', true, 'dragon1', 'B1050');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (73, 73, 'GPS III SV01', false, '2018', '2018-11-0 14:51:0', false, false, 'falcon9', 'ccafs_slc_40', 'SpaceX&#39;s twenty-first flight of 2018 launched the first of the new GPS III satellites (Block IIIA) for the United States Air Force and was SpaceX&#39;s first EELV mission. The spacecraft was delivered to a MEO transfer orbit from SLC-40 at Cape Canaveral Air Force Station. This mission was the first to fly with the redesigned COPV on the first stage (B1054) as well as the second. The booster was expended.', true, null, 'B1054');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (74, 74, 'Iridium NEXT Mission 8', false, '2019', '2019-0-5 16:31:0', false, false, 'falcon9', 'vafb_slc_4e', 'SpaceX&#39;s first flight of 2019 will be the eighth and final launch of its planned Iridium flights. Delivering 10 satellites to low earth orbit, this brings the total up to 75 and completes the Iridium NEXT constellation. This mission launches from SLC-4E at Vandenberg AFB. The booster is expected to land on JRTI.', true, null, 'B1049');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (75, 75, 'Nusantara Satu (PSN-6) / S5 / Beresheet', false, '2019', '2019-1-5 2:45:0', false, false, 'falcon9', 'ccafs_slc_40', 'SpaceX will launch this rideshare to GTO for Space Systems Loral (SSL). The primary payload for this mission is Nusantara Satu, a communications satellite built by SSL for the private Indonesian company PT Pasifik Satelit Nusantara (PSN). Spaceflight Industries&#39; GTO-1 mission consists of two secondary payloads. One of those is Beresheet, the lunar lander built by the Israeli non-profit organization, SpaceIL. Beresheet will make its own way to the moon from GTO. The other secondary is Air Force Research Lab&#39;s (Space Situational Awareness) S5 mission, which hitches a ride to GEO aboard Nusantara Satu. This mission launches from SLC-40 at Cape Canaveral AFS. The booster is expected to land on OCISLY.', true, null, 'B1048');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (76, 76, 'CCtCap Demo Mission 1', false, '2019', '2019-2-6 8:45:0', false, false, 'falcon9', 'ksc_lc_39a', 'Demonstration Mission 1 (DM-1) will launch Dragon 2 as part of NASA&#39;s Commercial Crew Transportation Capability program. This mission will demonstrate Dragon 2, and Falcon 9 in its configuration for crewed missions. DM-1 will launch from LC-39A at Kennedy Space Center, likely carrying some cargo to the International Space Station. The booster is expected to land on OCISLY.', true, 'dragon2', 'B1051');
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (77, 77, 'ArabSat 6A', true, '2019', '2019-3-1 0:36:0', false, false, 'falconheavy', 'ksc_lc_39a', 'SpaceX will launch Arabsat 6A to a geostationary transfer orbit from SLC-39A, KSC. The satellite is a geostationary telecommunications satellite built by Lockheed Martin for the Saudi Arabian company Arabsat. This will be the first operational flight of Falcon Heavy, and also the first Block 5 Falcon Heavy. All three cores will be new Block 5 cores. The side cores are expected to land at LZ-1 and LZ-2, and the center core is expected to land on OCISLY.', null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (78, 78, 'CRS-17', true, '2019', '2019-3-4 12:15:0', false, false, 'falcon9', 'ccafs_slc_40', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (79, 79, 'RADARSAT C-1, C-2, C-3', true, '2019', '2019-4-4 2:0:0', true, false, 'falcon9', 'vafb_slc_4e', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (80, 80, 'Amos-17', true, '2019', '2019-4-1 2:0:0', true, false, 'falcon9', 'ccafs_slc_40', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (81, 81, 'Starlink', true, '2019', '2019-4-3 2:0:0', true, true, 'falcon9', 'ccafs_slc_40', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (82, 82, 'STP-2', true, '2019', '2019-5-6 2:0:0', true, true, 'falconheavy', 'ksc_lc_39a', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (83, 83, 'Crew Dragon In Flight Abort Test', true, '2019', '2019-5-6 2:0:0', true, true, 'falcon9', 'ksc_lc_39a', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (84, 84, 'CRS-18', true, '2019', '2019-6-1 2:0:0', true, false, 'falcon9', 'ccafs_slc_40', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (85, 85, 'CCtCap Demo Mission 2', true, '2019', '2019-6-4 2:0:0', true, false, 'falcon9', 'ksc_lc_39a', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (86, 86, 'JCSat 18 / Kacific 1', true, '2019', '2019-6-1 2:0:0', true, true, 'falcon9', 'ccafs_slc_40', 'JCSat 18 / Kacific 1 is a joint high-throughput communication satellite of Kacific Broadband Satellites Pte Ltd, Singapore, and SKY Perfect JSAT Corporation, Japan, to be operated in Ka-band for mobile telephone, data and internet users throughout the Asia-Pacific region.', null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (87, 87, 'CRS-19', true, '2019', '2019-11-3 1:0:0', true, false, 'falcon9', 'ksc_lc_39a', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (88, 88, 'GPS III SV03 (Columbus)', true, '2019', '2019-11-0 1:0:0', true, true, 'falcon9', 'ccafs_slc_40', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (89, 89, 'USCV-1 (NASA Crew Flight 1)', true, '2019', '2019-11-0 1:0:0', true, true, 'falcon9', 'ksc_lc_39a', null, null, null, null);
insert into launches (id, flight_number, mission_name, upcoming, year, timestamp, is_tentative, tbd, rocket_id, launchpad_id, details, success, capsule_serial, core_serial) values (90, 90, 'ALINA', true, '2019', '2019-9-2 2:0:0', true, true, 'falcon9', 'ccafs_slc_40', null, null, null, null);
